import logo from './logo.svg';
import './App.css';
import { useState } from "react";
import VehicleOdomCard from './components/VehicleOdom';

function App() {
  const [odom, setOdom] = useState({
    northing: 10.0,
    easting: 655432.21635,
    zone: [19, 'T'],
    depth: 15.0,
    heading: 59.5,
    pitch: 0.5,
    roll: 0.32,
  });

  return (
    <div className="app">
      <VehicleOdomCard odom = {odom}/>
    </div>
  );
}

export default App;
